import React from "react";
import "./Stories.css";
import Story from "./Story";

const Stories = () => {
  return (
    <div className="storyList">
      <Story
        image="https://scontent.fadb2-2.fna.fbcdn.net/v/t1.0-9/385635_122181927916741_1091664098_n.jpg?_nc_cat=105&ccb=1-3&_nc_sid=cdbe9c&_nc_ohc=9ZlU82dqY58AX92Tajf&_nc_ht=scontent.fadb2-2.fna&oh=5e541c7123f123f5e7254e5792b5bb28&oe=607EB281"
        name="Ada Özyeşilova"
      />
      <Story
        image="https://yt3.ggpht.com/ytc/AAUvwnhK7Z8KAunniLRpuZtDPgpp5tLHuzMdQZyAlQVz=s900-c-k-c0x00ffffff-no-rj"
        name="Tugce Nur Batmaz"
      />

      <Story
        image="https://scontent.fadb2-2.fna.fbcdn.net/v/t1.0-9/68749037_662768954223492_1187529032523055104_o.jpg?_nc_cat=109&ccb=1-3&_nc_sid=09cbfe&_nc_ohc=oHmvQ5SfEmwAX8VtUQt&_nc_ht=scontent.fadb2-2.fna&oh=cf6e1f573e5daee77dcafab95dc6e7d0&oe=60817F72"
        name="İbrahim Özyeşilova"
      />
      <Story
        image="https://scontent.fadb2-2.fna.fbcdn.net/v/t31.0-8/469038_116376928497241_1423745394_o.jpg?_nc_cat=105&ccb=1-3&_nc_sid=174925&_nc_ohc=HSGH4HHxkrEAX997_nk&_nc_ht=scontent.fadb2-2.fna&oh=5cac5e56060435afc974e0e5beba9e60&oe=607FBB21"
        name="Dilek Özyeşilova"
      />

      {/*Story*/}
      {/*Story*/}
    </div>
  );
}

export default Stories;
